// 文字コード検索
fn mapping_utf8(ch: u32) -> Option<u32> {
    // 上位、下位位置を取得
    let hi = get_cp932_hi_group(ch);
    let lw = (ch & 0x3f) as u8;

    // 変換テーブルを取得
    let group = get_cp932_to_utf8(hi);

    // 文字コード検索
    let mut j: usize = 0;
    while j < group.len() {
        if lw == group[j].0 {
            return Some(group[j].1 as u32);
        }
        else if lw < group[j].0 {
            j = (j << 1) + 1;
        }
        else {
            j = (j << 1) + 2;
        }
    }

    None
}

fn add_utf8_byte(ans: &mut Vec<u8>, v: u32) {
    if v < 0x80 {
        ans.push(v as u8);
    }
    else if v < 0x800 {
        ans.push(0xc0 + (v >> 6) as u8);
        ans.push(0x80 + (v & 0x3f) as u8);
    }
    else if v < 0x10000 {
        ans.push(0xe0 + (v >> 12) as u8);
        ans.push(0x80 + (v >> 6 & 0x3f) as u8);
        ans.push(0x80 + (v & 0x3f) as u8);
    }
    else if v < 0x200000 {
        ans.push(0xf0 + (v >> 18) as u8);
        ans.push(0x80 + (v >> 12 & 0x3f) as u8);
        ans.push(0x80 + (v >> 6 & 0x3f) as u8);
        ans.push(0x80 + (v & 0x3f) as u8);
    }
    else if v < 0x4000000 {
        ans.push(0xf8 + (v >> 24) as u8);
        ans.push(0x80 + (v >> 18 & 0x3f) as u8);
        ans.push(0x80 + (v >> 12 & 0x3f) as u8);
        ans.push(0x80 + (v >> 6 & 0x3f) as u8);
        ans.push(0x80 + (v & 0x3f) as u8);
    }
    else {
        ans.push(0xfc + (v >> 30) as u8);
        ans.push(0x80 + (v >> 24 & 0x3f) as u8);
        ans.push(0x80 + (v >> 18 & 0x3f) as u8);
        ans.push(0x80 + (v >> 12 & 0x3f) as u8);
        ans.push(0x80 + (v >> 6 & 0x3f) as u8);
        ans.push(0x80 + (v & 0x3f) as u8);
    }
}

pub fn convert(source: &Vec<u8>) -> Result<String, String> {
    let ptr = source.as_ptr();
    let mut ans: Vec<u8> = Vec::new();

    let mut i: isize = 0;
    unsafe {
        while i < source.len() as isize {
            let c = *ptr.offset(i);
            if (c & 0x80) == 0 {
                ans.push(c);
                i += 1;
            }
            else {
                let v = c as u32 * 256 + *ptr.offset(i + 1) as u32;
                match mapping_utf8(v) {
                    Some(v) => {
                        add_utf8_byte(&mut ans, v);
                    },
                    _ => {
                        return Err("変換テーブルの文字に一致しない".to_string());
                    },
                }
                i += 2;
            }    
        }
    }

    if let Ok(s) = String::from_utf8(ans) {
        Ok(s)
    }
    else {
        Err("文字列変換に失敗".to_string())
    }
}